		[MenuItem("MyTools/CreateNavMeshes")]
		static void CreateNavMeshes()
		{

				int MeshType =0; //0=land, 1=water, 2 = lava
				//int i=1;
				for (int i=1; i <=60; i++)
				{
					GameObject newObj = GameObject.Find("_GroundMeshTest (" + i + ")");
					NavMeshRig nmrx=newObj.GetComponent<NavMeshRig>();
					nmrx.NavMesh.VisualHeightOffset=1;
					//nmrx.NavMesh.GraphTags.Add("Land");
					nmrx.NavMesh.IncludedLayers= LayerMask.NameToLayer("MapMesh");
					nmrx.NavMesh.WalkableHeight=0.5f;
					nmrx.NavMesh.WalkableRadius=0.2f;
					nmrx.NavMesh.StepHeight=0.1f;
					nmrx.NavMesh.CellSize=0.1f;
					nmrx.NavMesh.MaxVertexError=0;
					nmrx.NavMesh.MaxSegmentLength=5;
					nmrx.NavMesh.UnwalkableTags.Capacity=45;
					AddUnWalkables(nmrx, i);
					nmrx.NavMesh.UnwalkableTags.Add("SOLIDWALL");
					nmrx.NavMesh.UnwalkableTags.Add("Ceiling");
					AddUnWalkables(nmrx,i);	
					
					//GameObject dupObj = GameObject.Instantiate(newObj);
					if (i<=30)//25 land
					{
					newObj.name= "_GroundMesh" + i;
					}
					else if (i<=50)//10 water
					{
						newObj.name= "_WaterMesh" + (i-30);
					}
					else
					{
						newObj.name= "_LavaMesh" + (i-50);	
					}
				}
				return;

		}

		static void AddUnWalkables(NavMeshRig nmrx, int index)
		{
			for (int i =1; i <=60; i++)//45 possbile navmeshes.
			{
				if (i<=30)//25 land
				{
					if (index!=i)
					{
						nmrx.NavMesh.UnwalkableTags.Add("LAND_" + i);
					}
				}
				else if (i<=50)//10 water
				{
					if (index!=i)
					{
						nmrx.NavMesh.UnwalkableTags.Add("WATER_" + (i-30));
					}
				}
				else if (i <= 60)//10 lava
				{
					if (index!=i)
					{
						nmrx.NavMesh.UnwalkableTags.Add("LAVA_" + (i-50));
					}		
				}				
			}

		}
